import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import calculators from "./data/calculators"; // Import data file
import WhatIDo from "./WhatIDo"; // Example component

function App() {
  return (
    <Router>
      <div className="navbar">
        <h1>My Portfolio</h1>
        <ul className="content">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/whatido">What I Do</Link></li>
          <li><Link to="/projects">Projects</Link></li>
          <li><Link to="/about">About Me</Link></li>
        </ul>
      </div>

      {/* Grid Layout */}
      <div className="grid-container">
        {calculators.map((calc, index) => (
          <div className="grid-item" key={index}>
            <img src={calc.img} alt={calc.label} className="grid-image" />
            <h3>{calc.label}</h3>
            <Link to={calc.link}>
              <button className="grid-button">Launch Calculator</button>
            </Link>
          </div>
        ))}
      </div>

      {/* Routes */}
      <Routes>
        <Route path="/whatido" element={<WhatIDo />} />
        {calculators.map((calc, index) => (
          <Route key={index} path={calc.link} element={<h1>{calc.label} Page</h1>} />
        ))}
      </Routes>
    </Router>
  );
}

export default App;
